import { Link, useNavigate } from "react-router-dom";
import styled from "styled-components";

const HomeBtn = styled.div`
  display: flex;
`;

function Header() {
  const navigate = useNavigate();
  const onClick = () => {
    navigate("/Coins");
  };
  return (
    <header>
      <ul>
        <li>
          <Link to="/">Home</Link>
        </li>
        <li>
          <button onClick={onClick}>Coins</button>
        </li>
      </ul>
      <hr />
    </header>
  );
}

export default Header;
